n Seura'),(774,50,'Item',46,0,'20:28'),(775,50,'Item',43,0,'2151'),(776,50,'Item',44,0,'suomi'),(777,50,'Item',51,0,'kirje'),(778,50,'Item',52,0,'http://localhost/omeka/uploads/2151_C.N.Keckman.xml'),(779,50,'Item',53,0,'http://localhost/uploads/lnak020_028a_f.jpg'),(780,50,'Item',54,0,'http://localhost/uploads/lnak020_028b_f.jpg'),(781,50,'Item',55,0,'http://localhost/uploads/lnak020_028c_f.jpg'),(782,50,'Item',56,0,'http://localhost/uploads/lnak020_028d_f.jpg'),(786,48,'Item',61,1,'<p>Lönnrotin kirjekonseptin mukana on 159 säkeen mittainen kalevalamittainen runo. On epäselvää, tarkoittiko Lönnrot runon kirjeen mukaan. Koska kallisarvoista paperia oli niukasti saatavilla, kaikki paperilla oleva tila tuli käytetyksi. Kyseessä on ”Porolaulu”, jonka Lönnrot tallensi yhdeltä <em>Kalevalan</em> laulajista, vienankarjalaiselta Martiska Karjalaiselta (k. 1839) huhtikuussa 1834. Porolaulu on omaelämäkerrallinen ja paikallishistoriallinen rahvaanlaulu rajaseudun porovarkauksista. Laulaja on yhdistellyt eri runolajeja, paikallisia nimiä ja tositapahtumia. <em>Suomen Kansan Vanhoissa Runoissa</em> on kaksi Martiskalta tallennettua versiota Porolaulusta (<em>SKVR</em> XV 416 ja 417). (Ks. lisää <em>KSVK</em> 81 / Tarkka 2002: 259−260, 297.)</p>\n<p>Kirjekonseptin Porolaulu ei täysin vastaa kumpaakaan SKVR:n runotekstiä. Lönnrot julkaisi Porolaulun ruotsiksi käännettynä Martiska Karjalaisen laulajaesittelyn yhteydessä <em>Helsingfors Morgonbladissa</em> kesäkuussa 1835. Kirjekonseptiin kirjoitettu laulu vaikuttaa lehdessä julkaistun esityöltä. Suomenkielisen laulun yhteyteen lyijykynällä, todennäköisesti jälkikäteen kirjoitettu, ruotsinkielinen käännös viittaa lehtijulkaisun valmistelutöihin. Lotte Tarkan mukaan Lönnrot on kompiloinut yhteen aineksia ainakin kahdesta eri runosta, ja kuten hän itsekin sanoo <em>Helsingfors Morgonbladissa</em>, hän on hyödyntänyt eri versioita ja useita laulajia. Kirjeessä mukana oleva ja ruotsiksi julkaistu Porolaulu on Lönnrotin oma tulkinta rajaseudulla pyörineistä poroaihelmista. (Sähköpostikeskustelu Lotte Tarkan kanssa 12.9.2016.)</p>'),(787,1,'Collection',49,0,'Letters sent by Lönnrot to Matthias Alexander Castrén'),(788,2,'Collection',49,0,'Letters sent by Lönnrot to Sven Gabriel Elmgren'),(790,4,'Collection',49,0,'Letters sent by Lönnrot to Carl Niklas Keckman'),(791,3,'Collection',49,0,'Letters sent by Lönnrot to Frans Johan Rabbe'),(792,1,'Collection',41,0,'Mathias Alexander Castrén oli bla bla bla bla'),(793,6,'Collection',50,0,'Lönnrot > Warelius, Antero'),(794,6,'Collection',49,0,'Letters sent by Lönnrot to Antero Warelius'),(810,10,'Collection',50,0,'Lönnrot > Schildt-Kilpinen, Wolmar Styrbjörn'),(811,10,'Collection',49,0,'Letters sent by Lönnrot to Wolmar Styrbjörn Schildt-Kilpinen'),(812,11,'Collection',50,0,'Lönnrot > Ståhlberg, Carl Henrik'),(813,11,'Collection',49,0,'Letters sent by Lönnrot to Carl Henrik Ståhlberg'),(816,13,'Collection',50,0,'Lönnrot > Roos, Samuel'),(817,13,'Collection',49,0,'Letters sent by Lönnrot to Samuel Roos'),(820,15,'Collection',50,0,'Lists of recipients'),(821,15,'Collection',49,0,'Lists with various recipients'),(822,16,'Collection',50,0,'Lönnrot > Örnhjelm'),(823,16,'Collection',49,0,'Letters sent by Lönnrot to Carl Saxa'),(824,17,'Collection',50,0,'Lönnrot > Ticklén, Johan Fredrik'),(825,17,'Collection',49,0,'Letters sent by Lönnrot to Johan Fredrik Ticklén'),(826,46,'Item',61,0,'Test commentary'),(827,18,'Collection',50,0,'Family letters'),(828,18,'Collection',49,0,'Daughters Maria and Elina, parents Fredrik Johan and Ulrika, brothers Gabriel Martin and Henrik Johan, Henrik\'s wife Christina Elisabet and son Frans Fredrik, and other family members'),(829,19,'Collection',50,0,'Lönnrot > Oberg'),(830,20,'Collection',50,0,'Lönnrot > Newspapers and Magazines'),(831,19,'Collection',49,0,'Letters sent by Lönnrot to Finnish Literature Society'),(832,21,'Collection',50,0,'Lönnrot > Ähnberg');
