),(418,'tag_delimiter',','),(419,'path_to_convert','/usr/bin'),(425,'public_theme','lonnrot'),(429,'theme_lonnrot_options','a:17:{s:10:\"text_color\";s:7:\"#444444\";s:16:\"background_color\";s:7:\"#FFFFFF\";s:10:\"link_color\";s:7:\"#888888\";s:12:\"button_color\";s:7:\"#000000\";s:17:\"button_text_color\";s:7:\"#FFFFFF\";s:18:\"header_title_color\";s:7:\"#000000\";s:4:\"logo\";N;s:17:\"header_background\";N;s:11:\"footer_text\";s:0:\"\";s:24:\"display_footer_copyright\";s:1:\"0\";s:21:\"display_featured_item\";s:1:\"0\";s:27:\"display_featured_collection\";s:1:\"0\";s:24:\"display_featured_exhibit\";s:1:\"0\";s:21:\"homepage_recent_items\";s:0:\"\";s:13:\"homepage_text\";s:3702:\"<p><strong>Lorem ipsum</strong> dolor sit amet, consectetuer adipiscing elit. Sed posuere interdum sem. Quisque ligula eros ullamcorper quis, lacinia quis facilisis sed sapien. Mauris varius diam vitae arcu. Sed arcu lectus auctor vitae, consectetuer et venenatis eget velit. Sed augue orci, lacinia eu tincidunt et eleifend nec lacus. Donec ultricies nisl ut felis, suspendisse potenti. Lorem ipsum ligula ut hendrerit mollis, ipsum erat vehicula risus, eu suscipit sem libero nec erat. Aliquam erat volutpat. Sed congue augue vitae neque. Nulla consectetuer porttitor pede. Fusce purus morbi tortor magna condimentum vel, placerat id blandit sit amet tortor.</p>\n<p>Mauris sed libero. Suspendisse facilisis nulla in lacinia laoreet, lorem velit accumsan velit vel mattis libero nisl et sem. Proin interdum maecenas massa turpis sagittis in, interdum non lobortis vitae massa. Quisque purus lectus, posuere eget imperdiet nec sodales id arcu. Vestibulum elit pede dictum eu, viverra non tincidunt eu ligula.</p>\n<p>Nam molestie nec tortor. Donec placerat leo sit amet velit. Vestibulum id justo ut vitae massa. Proin in dolor mauris consequat aliquam. Donec ipsum, vestibulum ullamcorper venenatis augue. Aliquam tempus nisi in auctor vulputate, erat felis pellentesque augue nec, pellentesque lectus justo nec erat. Aliquam et nisl. Quisque sit amet dolor in justo pretium condimentum.</p>\n<p>Lönnrot syntyi Sammatissa <a title=\"Paikkarin torppa\" href=\"https://fi.wikipedia.org/wiki/Paikkarin_torppa\">Paikkarin torpassa</a> vuonna 1802 kylänräätäli Fredrik Johan Lönnrotin ja hänen vaimonsa Ulrika Wahlbergin neljäntenä lapsena. 1800-luvulla Suomessa oli hankalaa saada koulusivistystä, mutta Eliaksen vanhin veli Henrik Johan Lönnrot huomasi veljensä kiinnostuksen kirjallisuutta kohtaan ja päätti lähettää hänet Tammisaaren <a title=\"Pedagogio\" href=\"https://fi.wikipedia.org/wiki/Pedagogio\">pedagogioon</a> lokakuun lopussa vuonna 1814. Lönnrot kävi 1816–1818 Turun katedraalikoulua, missä hän oppi muun muassa ruotsia ja latinaa, jota hän vielä kolme lukuvuotta koulussa oltuaankin puhui kankeasti ja virheellisesti.<sup class=\"reference\"><a href=\"https://fi.wikipedia.org/wiki/Elias_L%C3%B6nnrot#cite_note-2\">[2]</a></sup><sup class=\"reference\"><a href=\"https://fi.wikipedia.org/wiki/Elias_L%C3%B6nnrot#cite_note-3\">[3]</a></sup></p>\nTalous oli nuorella opiskelijalla tiukoilla. Hän hankki rahansa ompelemalla vaatteita ja kiertelemällä ympäriinsä laulavana teininä. Ilmeisesti Lönnrot myös menestyi opinnoissaan, mikä tulee ilmi koulun papereista ja koulutoveri Israel Weurlanderin muisteluksista. Rahat eivät silti riittäneet, ja Lönnrotin oli pakko lopettaa koulunkäynti; on myös mahdollista että lähtö johtui uskosta parempiin menestysmahdollisuuksiin toisaalla.<sup class=\"reference\"><a href=\"https://fi.wikipedia.org/wiki/Elias_L%C3%B6nnrot#cite_note-4\">[4]</a></sup> Sammatin kappalaisadjunktin (eli kappalaisen apulaisen) Johan Lönnqvistin avulla Lönnrot pääsi vuonna 1820 opiskelemaan Porvoon lyseoon. Epävarman rahatilanteen takia Lönnrot päätti pian muuttaa <a title=\"Hämeenlinna\" href=\"https://fi.wikipedia.org/wiki/H%C3%A4meenlinna\">Hämeenlinnaan</a>, jossa apteekkari Lorenz Johan Bjugg palkkasi latinaa osaavan apteekkarioppilaan. Pian kuitenkin <a title=\"Piirilääkäri\" href=\"https://fi.wikipedia.org/wiki/Piiril%C3%A4%C3%A4k%C3%A4ri\">piirilääkäri</a> Johan Erik Sabelli ja Hämeenlinnan <a title=\"Triviaalikoulu\" href=\"https://fi.wikipedia.org/wiki/Triviaalikoulu\">triviaalikoulun</a> rehtori Henrik Långström järjestivät Lönnrotin opiskelemaan rehtorin johdolla itsenäisesti ja työsopimus apteekissa lopetettiin.\";s:17:\"item_file_gallery\";s:1:\"1\";s:19:\"use_advanced_search\";s:1:\"0\";}'),(537,'guest_user_capabilities',''),(538,'guest_user_short_capabilities',''),(539,'guest_user_dashboard_label','My Account'),(540,'guest_user_login_text','Login'),(541,'guest_user_register_text','Register'),(542,'guest_user_open','0'),(543,'guest_user_instant_access','0'),(544,'guest_user_recaptcha','1'),(559,'commenting_threaded','1'),(560,'commenting_comments_label',''),(561,'commenting_allow_public','0'),(562,'commenting_require_public_moderation','0'),(563,'commenting_moderate_roles','a:1:{i:0;s:5:\"admin\";}'),(564,'commenting_comment_roles','a:4:{i:0;s:5:\"admin\";i:1;s:10:\"researcher\";i:2;s:11:\"contributor\";i:3;s:5:\"guest\";}'),(565,'commenting_reqapp_comment_roles','a:1:{i:0;s:5:\"guest\";}'),(566,'commenting_allow_public_view','1'),(567,'commenting_view_roles','a:3:{i:0;s:5:\"admin\";i:1;s:10:\"researcher\";i:2;s:11:\"contributor\";}'),(568,'commenting_wpapi_key','ae7ffbc7f462'),(569,'install_plugin','Save Changes'),(570,'csrf_token','98acc43bc29defb40cfa16de9f7acc87'),(577,'omeka_update','a:2:{s:14:\"latest_version\";s:3:\"2.5\";s:12:\"last_updated\";i:1492502740;}'),(590,'solr_search_host','localhost'),(591,'solr_search_port','8080'),(592,'solr_search_core','/solr/omeka/'),(593,'simple_pages_filter_page_content','0'),(594,'universalviewer_append_collections_show','1'),(595,'universalviewer_append_items_show','1'),(596,'universalviewer_max_dynamic_size','50000000'),(597,'universalviewer_licence','http://www.example.org/license.html'),(598,'universalviewer_attribution','Provided by Example Organization'),(599,'univer