s Johan Rabbe','Elias Lönnrot > Frans Johan Rabbe Kirjoituspaikka: Kajaani Lönnrot, Elias Suomalaisen Kirjallisuuden Seuran\r\n                            kirjallisuusarkisto Suomalaisen Kirjallisuuden Seura 1835-10-23 Suomalaisen Kirjallisuuden Seura Suomalaisen Kirjallisuuden Seura 20:54 300 ruotsi kirje http://localhost/omeka/uploads/300_F._J._Rabbe.xml http://localhost/uploads/lnak020_054a_f.jpg http://localhost/uploads/lnak020_054b_f.jpg http://localhost/uploads/lnak020_054c_f.jpg Test commentary '),(53,'Item',47,1,'Elias Lönnrot > Frans Johan Rabbe','Elias Lönnrot > Frans Johan Rabbe Kirjoituspaikka: Kajaani Lönnrot, Elias Suomalaisen Kirjallisuuden Seuran kirjallisuusarkisto Suomalaisen Kirjallisuuden Seura 1836-05-06 Suomalaisen Kirjallisuuden Seura Suomalaisen Kirjallisuuden Seura 20:59 352 ruotsi kirje http://localhost/omeka/uploads/352_F._J._Rabbe.xml http://localhost/uploads/lnak020_059a_f.jpg http://localhost/uploads/lnak020_059b_f.jpg http://localhost/uploads/lnak020_059c_f.jpg '),(54,'Item',48,1,'Elias Lönnrot > Frans Johan Rabbe','Elias Lönnrot > Frans Johan Rabbe Kirjoituspaikka: Lönnrot, Elias Suomalaisen Kirjallisuuden Seuran arkiston kirjallisuuden ja kulttuurihistorian arkistoaineistot Suomalaisen Kirjallisuuden Seura 1835-05-00 Suomalaisen Kirjallisuuden Seura Suomalaisen Kirjallisuuden Seura Lna 79 260 ruotsi suomi kirjekonsepti http://localhost/omeka/uploads/260_F._J._Rabbe.xml http://localhost/uploads/lna079_080_f.jpg http://localhost/uploads/lna079_081_f.jpg http://localhost/uploads/lna079_082_f.jpg http://localhost/uploads/lna079_083_f.jpg http://localhost/uploads/lna079_084_f.jpg <p>Lönnrotin kirjekonseptin mukana on 159 säkeen mittainen kalevalamittainen runo. On epäselvää, tarkoittiko Lönnrot runon kirjeen mukaan. Koska kallisarvoista paperia oli niukasti saatavilla, kaikki paperilla oleva tila tuli käytetyksi. Kyseessä on ”Porolaulu”, jonka Lönnrot tallensi yhdeltä <em>Kalevalan</em> laulajista, vienankarjalaiselta Martiska Karjalaiselta (k. 1839) huhtikuussa 1834. Porolaulu on omaelämäkerrallinen ja paikallishistoriallinen rahvaanlaulu rajaseudun porovarkauksista. Laulaja on yhdistellyt eri runolajeja, paikallisia nimiä ja tositapahtumia. <em>Suomen Kansan Vanhoissa Runoissa</em> on kaksi Martiskalta tallennettua versiota Porolaulusta (<em>SKVR</em> XV 416 ja 417). (Ks. lisää <em>KSVK</em> 81 / Tarkka 2002: 259−260, 297.)</p>\n<p>Kirjekonseptin Porolaulu ei täysin vastaa kumpaakaan SKVR:n runotekstiä. Lönnrot julkaisi Porolaulun ruotsiksi käännettynä Martiska Karjalaisen laulajaesittelyn yhteydessä <em>Helsingfors Morgonbladissa</em> kesäkuussa 1835. Kirjekonseptiin kirjoitettu laulu vaikuttaa lehdessä julkaistun esityöltä. Suomenkielisen laulun yhteyteen lyijykynällä, todennäköisesti jälkikäteen kirjoitettu, ruotsinkielinen käännös viittaa lehtijulkaisun valmistelutöihin. Lotte Tarkan mukaan Lönnrot on kompiloinut yhteen aineksia ainakin kahdesta eri runosta, ja kuten hän itsekin sanoo <em>Helsingfors Morgonbladissa</em>, hän on hyödyntänyt eri versioita ja useita laulajia. Kirjeessä mukana oleva ja ruotsiksi julkaistu Porolaulu on Lönnrotin oma tulkinta rajaseudulla pyörineistä poroaihelmista. (Sähköpostikeskustelu Lotte Tarkan kanssa 12.9.2016.)</p> '),(55,'Item',49,1,'Elias Lönnrot > Carl Niklas Keckman','Elias Lönnrot > Carl Niklas Keckman Kirjoituspaikka: Uhutkylä Lönnrot, Elias Suomalaisen Kirjallisuuden Seuran arkiston kirjallisuuden ja kulttuurihistorian arkistoaineistot Suomalaisen Kirjallisuuden Seura 1826-11-24 Suomalaisen Kirjallisuuden Seura Suomalaisen Kirjallisuuden Seura Lna 79 2003 suomi kirjekonsepti http://localhost/omeka/uploads/2003_C.N.Keckman.xml http://localhost/uploads/lna079_243_f.jpg '),(56,'Item',50,1,'Elias Lönnrot > Carl Niklas Keckman','Elias Lönnrot > Carl Niklas Keckman Kirjoituspaikka: Uhutkylä Lönnrot, Elias Suomalaisen Kirjallisuuden Seuran arkiston kirjallisuuden ja kulttuurihistorian arkistoaineistot Suomalaisen Kirjallisuuden Seura Suomalaisen Kirjallisuuden Seura Suomalaisen Kirjallisuuden Seura 20:28 2151 suomi kirje http://localhost/omeka/uploads/2151_C.N.Keckman.xml http://localhost/uploads/lnak020_028a_f.jpg http://localhost/uploads/lnak020_028b_f.jpg http://localhost/uploads/lnak020_028c_f.jpg http://localhost/uploads/lnak020_028d_f.jpg '),(83,'Comment',23,1,'Lisätään vielä kommentti.','Lisätään vielä kommentti. '),(84,'Collection',6,1,'Lönnrot > Warelius, Antero','Lönnrot > Warelius, Antero Letters sent by Lönnrot to Antero Warelius '),(78,'Comment',20,1,'T&auml;m&auml; on kommentti.','<p>T&auml;m&auml; on kommentti.</p> '),(79,'Comment',21,1,'T&auml;ss&auml;kin on kommentti.','<p>T&auml;ss&auml;kin on kommentti.</p> '),(103,'Collection',21,1,'Lönnrot > Ähnberg','Lönnrot > Ähnberg '),(100,'Collection',18,1,'Family letters','Family letters Daughters Maria and Elina, parents Fredrik Johan and Ulrika, brothers Gabriel Martin and Henrik Johan, Henrik\'s wife Christina Elisabet and son Frans Fredrik, and other family members '),(82,'Comment',22,1,'Testikommentti','<p>Testikommentti</p> '),(102,'Collection',20,1,'Lönnrot > Newspapers and Magazines','Lönnrot > Newspapers and Magazines '),(101,'Collection',19,1,'Lönnrot > Oberg','Lönnrot > Oberg Letters sent by Lönnrot to Finnish Literature Society '),(90,'Collection',10,1,'Lönnrot > Schildt-Kilpinen, Wolmar Styrbjörn','Lönnrot > Schildt-Kilpinen, Wolmar Styrbjörn Letters sent by Lönnrot to Wolmar Styrbjörn Schildt-Kilpinen '),(91,'Collection',11,1,'Lönnrot > Ståhlberg, Carl Henrik','Lönnrot > Ståhlberg, Carl Henrik Letters sent by Lönnrot to Carl Henrik Ståhlberg '),(93,'Collection',13,1,'Lönnrot > Roos, Samuel','Lönnrot > Roos, Samuel Letters sent by Lönnrot to Samuel Roos '),(95,'Collection',15,1,'Lists of recipients','Lists of recipients Lists with various recipients '),(96,'Collection',16,1,'Lönnrot > Örnhjelm','Lönnrot > Örnhjelm Letters sent by Lönnrot to Carl Saxa '),(97,'Collection',17,1,'Lönnrot > Ticklén, Johan Fredrik','Lönnrot > Ticklén, Johan Fredrik Let